import React from "react";

// img
import house from "./img/home.png";
import avatar from "./img/avatar.png";
import coding from "./img/coding.png";
import "./homepage.css";

export default function Home() {
  return (
    <div>
      <div className="navBar">
        <div className="d-flex justify-content-between mx-5 mt-5">
          <img className="houseimg" src={house} alt="Home icon">a</img>
          <a className="btn btn-sm btn-outline-primary customBtn" href="/">
            Say Hello
          </a>
        </div>
      </div>

      <section className="front-page">
        <h1>Designer, Frontend Developer & Mentor</h1>
        <h3>
          I design and code beautifully simple things, and I love what I do.
        </h3>
        <img alt="#" src={avatar}></img>
        <img alt="#" src={coding}></img>
      </section>
    </div>
  );
}
